import phone from "../img/phone.PNG";

const Row = (props) => {
  return (
    <div className="row">
      <div className="col-1">
        <div className="pre-head">{props.preHead}</div>
        <h1 className="head">{props.head}</h1>
        <div className="desc">
          <p>{props.desc1}
            Our online ordering food System will help you transform your website
            into a money-making machine
          </p>
          <p>
            No matter how much your busines grows, you will always be able to
            take free unlimited orders with zero costs.
          </p>
          <p>
            Power your business with our free restaurant online ordering system
            & you'll never have to worry about fees or commissions.
          </p>
        </div>
      </div>
      <div className="col-2">
        <img src={phone} alt="Phone with food" />
      </div>
    </div>
  );
};

export default Row;
